        function processEmails() {
            let inactiveEmailsText = document.getElementById("inactiveEmails").value.trim();
            if (!inactiveEmailsText) {
                alert("Please enter inactive emails.");
                return;
            }
            
            let inactiveEmails = new Set(inactiveEmailsText.split('\n').map(e => e.trim()));
            let removedEmailsText = "Removed Emails:\n";
            let notFoundEmailsText = "Not Found Emails:\n";
            let foundInactiveEmails = new Set();
            let removedEmails = {};
            
            for (let category in emailLists) {
                removedEmails[category] = {};
                for (let list in emailLists[category]) {
                    removedEmails[category][list] = [];
                    emailLists[category][list] = emailLists[category][list].filter(email => {
                        if (inactiveEmails.has(email)) {
                            removedEmails[category][list].push(email);
                            foundInactiveEmails.add(email);
                            return false;
                        }
                        return true;
                    });
                }
            }
            
            for (let category in removedEmails) {
                let categoryHasRemovals = false;
                for (let list in removedEmails[category]) {
                    if (removedEmails[category][list].length > 0) {
                        if (!categoryHasRemovals) {
                            removedEmailsText += `\n<div class='category'>${category.toUpperCase()}</div>\n`;
                            categoryHasRemovals = true;
                        }
                        removedEmailsText += `${list}:\n${removedEmails[category][list].join("\n")}\n\n`;
                    }
                }
            }
            
            let notFoundEmails = [...inactiveEmails].filter(email => !foundInactiveEmails.has(email));
            if (notFoundEmails.length > 0) {
                notFoundEmailsText += notFoundEmails.join("\n") + "\n";
            } else {
                notFoundEmailsText = "All inactive emails were found and removed.";
            }
            
            document.getElementById("removedEmails").innerHTML = removedEmailsText.trim();
            document.getElementById("notFoundEmails").innerText = notFoundEmailsText.trim();
        }
    </script>
